import React from 'react'
import { burger } from '../assets'

const Menu = () => {
  return (
    <div className='card--shadow'>
      <img src = {burger} alt="burger" className='h-[40px] w-[40px]'></img>
      <p className='text-white'>Hamburger</p>
    </div>
  )
}

export default Menu
